import React, { Suspense, Lazy } from 'react';
const PhotoList = Lazy(() => import('./PhotoList'));


const Photo = ({ images }) => {
	return <div><Suspense fallback={<GridLoader />}>{<PhotoList images={images} />}</Suspense></div>;
};

export default Photo;
